import Product from "./Product"

export default function Productlist(){
    return(
        <div className="productlist">
            <Product name="RTX 2070" price="35000" url="https://www.thevaluestore.in/image/cache/catalog/2020/Graphics-Card/Gigabyte/gv-n207swf3oc-8gd-1-270x270.jpg" />
            <Product name="RTX 2080" price="59000" url="https://5.imimg.com/data5/SELLER/Default/2022/11/GI/SO/CV/139444584/geforce-rtx-2080-8gb-graphics-car-500x500.jpg" />
            <Product name="RTX 3090" price="110000" url="https://rukminim2.flixcart.com/image/850/1000/km9ht3k0/graphics-card/9/i/a/tuf-geforce-rtx-3090-asus-original-imagf7k8ds4wefge.jpeg?q=90" />
            <Product name="RTX 4090" price="180000" url="https://m.media-amazon.com/images/I/71EP3+gnSxL._AC_UF894,1000_QL80_.jpg"></Product>
        </div>
    )
}
